import React from 'react';
import { Text } from './components/Text';

export const Form = () => {
  const fields = ['text', 'radio', 'checkbox'];

  const fieldType = (key) => {
    if (key === 'text') {
      return (
        <div class='mb-3'>
          <label>Text</label>
          <input type='text' class='form-control' />
        </div>
      );
    }

