    //     <input type='checkbox' class='form-control' name='set2' />
    //     <input type='checkbox' class='form-control' name='set2' />
    //   </div>;
    // }
  };

  return (
    <div>
      <Form class='row'>
        {fields.map((key, index) => (
          <React.Fragment key={index}>{fieldType(key)}</React.Fragment>
        ))}
      </Form>
    </div>
  );
};
